import React from 'react';
import s from './Dialogs.module.css';
const Dialogs = () => {
    return (
        <div>
            <div className='dialogs-items'>
                <div className='dialog-item'>Dimych</div>
                <div className='dialog-item'>Andrey</div>
                <div className='dialog-item'>Sveta</div>
                <div className='dialog-item'>Viktor</div>
                <div className='dialog-item'>Valera</div>
                <div className='dialog-item'>Sasha</div>
            </div>
            <div className='messages'>
                <div className="message">Hi</div>
                <div className="message">How is your day?</div>
                <div className="message">Yo</div>
            </div>
        </div>
    );
};

export default Dialogs;
